import axios from 'axios';
import { useEffect, useState } from 'react';
import { Post } from './post';

export function Sexual() {
    let [Posts, setPosts] = useState([{ postId: "", userId: "string", desc: "", like: [], comments: [], date: "", img: "", Askpro: false }]);
    let url = 'http://127.0.0.1:5789/post/verbal';

    useEffect(() => {

        axios.get(url)
            .then(response => {
                console.log(response.data);

                setPosts(response.data);
            });
    }

        , [])

